import React from 'react';
import { Card, Col } from 'react-bootstrap';
// import './Service.css'

const Service = (props) => {
    const { title, body, image, price } = props.service;
    return (

        // <col >

        //     <img src={image} alt="" />
        //     <h3>{title}</h3>
        //     <p>{price}</p>
        //     <p className="px-3">{body}</p>

        // </col >
        <Col>
            <Card>
                <Card.Img variant="top" src={image} />
                <Card.Body>
                    <Card.Title>{title}</Card.Title>
                    <Card.Text>
                        {price}
                    </Card.Text>
                    <Card.Text>
                        {body}
                    </Card.Text>
                </Card.Body>
            </Card>
        </Col>

    );
};

export default Service;
